        KparkFuser.KparkFuser fuser;
        private SimOptions options;
        private Dictionary<int, List<double>> TrustUpdates;

        public ExamineKparkRealtimeAlgorithm()
        {
            options = new SimOptions();          
            StartDate = new DateTime(2014, 9, 17, 6, 0, 0);
            EndDate = StartDate + new TimeSpan(28, 0, 0, 0);
            Actions = new List<DatabaseOccuapncyUpdateAction>();            
        }

        public double run()
        {
            Actions.Clear();
            TrustUpdates = new Dictionary<int, List<double>>();
            fuser = new KparkFuser.KparkFuser(Actions, options, TrustUpdates);
            DateTime CurrentTime = StartDate;
            TimeSpan TimeIncrement = new TimeSpan(1,0,0);
            while (CurrentTime < EndDate)
            {
                //Console.WriteLine(CurrentTime.ToString());
                fuser.run(CurrentTime);
                CurrentTime += TimeIncrement;
            }

            string TrustChangesCellArrayForMatlabAnalysis = CreateTrustChangesCellArray(this.TrustUpdates);

            double occupancyPerformance = calculatePerformance();
            return occupancyPerformance;
        }

