        private double calculatePerformance()
        {
            var PenaltyMatrix = new ExperimentInputParams().PenaltyMatrix;
            double p = 0, sumPenalty = 0;
            foreach (var action in Actions)
            {
                sumPenalty += PenaltyMatrix[action.RealTag-1][action.Tag-1];
            }
            p = sumPenalty / Actions.Count;
            return p;
        }

        public void OptimizeFusingOptions()
        {
            Random rand = new Random();
            double bestPerformance = double.MaxValue, currentPerformance;
            float[,] optionRange = SimOptions.optionRange;
            int numberOfVars = (int)optionRange.GetLength(0);
            float[] optionsValues = new float[numberOfVars];
            while (true)
            {
                currentPerformance = run();
                
                if (currentPerformance < bestPerformance)
                {
                    bestPerformance = currentPerformance;
                    WriteBest();
                    Console.WriteLine("Best Performance = " + bestPerformance + " and options: " + options.Stringify());
                }
                
                for (int i = 0; i < numberOfVars; i++)
                    optionsValues[i] = (float)(rand.NextDouble() * rand.NextDouble() * rand.NextDouble() * rand.NextDouble()) * (optionRange[i, 1] - optionRange[i, 0]) + optionRange[i, 0];
                options = new SimOptions(optionsValues[0], optionsValues[1], optionsValues[2], optionsValues[3], optionsValues[4], optionsValues[5]);
                
                fuser.ResetTagsProcessedField();                
            }
        }

        private void WriteBest()
        {
            using (FileStream fs = File.Open(@"bestOption.json", FileMode.Create))
            using (StreamWriter sw = new StreamWriter(fs))
            using (JsonWriter jw = new JsonTextWriter(sw))
            {
                jw.Formatting = Formatting.Indented;

                JsonSerializer serializer = new JsonSerializer();
                serializer.Serialize(jw, options);
            }
        }
